import React from 'react'
import { useNavigate } from 'react-router-dom';

export default function Header( {header} ) {
    return(
        <header className="header">
            {header}
            {localStorage.getItem('jwt') ? 
        (<button onClick={() => {
            localStorage.setItem('jwt', '');
            useNavigate('/');
        }}
        >
        Logout</button>) : ""}
        </header>
    )
}

